def get_latest_version(data: dict):
    return sorted(data['versions'], key=lambda el: el, reverse=True)[0]


def latest_version_url(data: dict, version: str):
    return data['versions'][version]['dist']['tarball']


def download_dependency(url: str, filename: str):

    response = requests.get(url, stream=True)
    file = tarfile.open(fileobj=response.raw, mode="r|gz")
    # print(file.getmembers())
    file.extractall(path=f"{TARGET_DIR}/{filename}")

    # all files are extracted to "package" directory, let's move it 1 level up
    source = os.path.join(os.path.curdir, f"{TARGET_DIR}/{filename}/package")
    destination = os.path.join(os.path.curdir, f"{TARGET_DIR}/{filename}")
    files = os.listdir(source)
    for file in files:
        file_name = os.path.join(source, file)
        try:
            shutil.move(file_name, destination)
        except shutil.Error:
            pass

    shutil.rmtree(source)

    return url


def main():
    package_file = json.load(open('source/package.json'))
    package_lock_file = json.load(open('source/package-lock.json'))

    for package_name in package_file['dependencies']:
        data = get_info_from_registry(package_name)
        latest = get_latest_version(data)
        dependency_url = latest_version_url(data, latest)
        download_dependency(dependency_url, package_name)


if __name__ == '__main__':
    main()
